import './App.css';
import React from 'react';
import ButtonUsage from './element/ButtonUsage';
import CustomizedTables from './element/CustomizedTables';

// import 'element-theme-default'; 

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ButtonUsage style={styles.container}/>
        <CustomizedTables style={styles.container}/>
      </header>
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'center',  // Centers horizontally
    alignItems: 'flex-start',  // Aligns towards the top (not full vertical center)
    height: '20vh',           // Full viewport height
    paddingTop: '20vh',        // Adjust this to move elements closer to the top
  }
};

export default App;
